import React from "react"
import { Component } from "react"
import './Raider.css'
 class Raiderclass extends Component
{
  render()
  {
    return(
      <div id="kbd">
      <img src="https://staticg.sportskeeda.com/wp-content/uploads/2016/07/rahul-chaudhari-1469527831-800.jpg" alt="kbd" />
      <h1>Rahul chaudari</h1>
      <h4>Poster boy</h4>
    </div>
    )
  }
}
export default Raiderclass;
